import {useNavigate}from 'react-router-dom'

function ProductsPage() {
  const nav = useNavigate()
  return (
      <div>
      <h1 onClick={nav.bind(this, -1)}>Products Page</h1>
      <ul>
        <li onClick={nav.bind()}>Product 1</li>
        <li>Product 2</li>
        <li>Product 3</li>
      </ul>
      </div>
  )
}

export default ProductsPage
